function findMinimumOperations(s1: string, s2: string, s3: string): number {
    // Helper function to check if three strings can be made equal by removing characters from the end
    const canBeMadeEqual = (x: string, y: string, z: string): boolean => {
        const minLen = Math.min(x.length, y.length, z.length);
        for (let i = 0; i < minLen; i++) {
            if (x[i] !== y[i] || x[i] !== z[i]) {
                return false;
            }
        }
        return true;
    };

    if (!canBeMadeEqual(s1, s2, s3)) {
        return -1;
    }

    // Calculate the minimum number of operations required
    let operations = 0;
    while (s1 !== s2 || s1 !== s3) {
        // Determine the longest string and remove its last character
        if (s1.length >= s2.length && s1.length >= s3.length) {
            s1 = s1.slice(0, -1);
        } else if (s2.length >= s1.length && s2.length >= s3.length) {
            s2 = s2.slice(0, -1);
        } else {
            s3 = s3.slice(0, -1);
        }
        operations++;

        // If at any point the strings become impossible to equalize, break early
        if (!canBeMadeEqual(s1, s2, s3)) {
            return -1;
        }
    }

    return operations;
}
